INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", "春咲 ひより", 0, 0, 1, 2, 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 1, 0, 1001, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", "草野 優衣", 0, 0, 1, 2, 1.4, "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 1, 0, 1002, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("少しは磨かれると思いますよ。", "士条 怜", 0, 0, 1, 2, 1.4, "フェンシングを始めてみては？", "キミに必要な集中力と感性が", 1, 0, 1003, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", "穂高 みそぎ", 0, 0, 1, 2, 1.5, "ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 1, 0, 1004, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("私といっしょに…\nいかない？", "風宮 あかり", 0, 0, 1, 2, 1.4, "風宮あかりです", "ねぇ…", 1, 0, 1006, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("食べ物の恨みは怖いのー", "出雲 宮子", 0, 0, 1, 2, 1.5, "出雲宮子なのー", "プリンたべたいのー", 1, 0, 1007, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("いいよ。\n見られることは運命さ…", "虹村 雪", 0, 0, 1, 2, 1.4, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, 1008, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("人呼んで「疾風の冥姫」!!", "柊杏奈", 0, 0, 1, 2, 1.4, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, 1009, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ほんまおおきにやわ～♪", "姫宮 真歩", 0, 0, 1, 2, 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, 1010, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ここで会ったが\n100年目～！", "衣之咲 璃乃", 0, 0, 1, 2, 1.4, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, 1011, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", "柏崎 初音", 0, 0, 1, 2, 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 1, 0, 1012, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", "美波 鈴奈", 0, 0, 1, 2, 1.4, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 1, 0, 1016, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("でも、沖縄もとってもいいとこさー", "喜屋武 香織", 0, 0, 1, 2, 1.4, "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 1, 0, 1017, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("イオちゃんって呼んでね。", "支倉 伊緒", 0, 0, 1, 2, 1.4, "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 1, 0, 1018, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ミミをおいてかないでぇ～", "茜 ミミ", 0, 0, 1, 2, 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, 1020, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ふぇぇぇぇぇん……", "栗林 くるみ", 0, 0, 1, 2, 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 1, 0, 1021, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("なんてありがとうございます！", "風宮 より", 0, 0, 1, 2, 1.4, "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 1, 0, 1022, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("私こっち行きたいー\nね、早く早くー", "北条 綾音", 0, 0, 1, 2, 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 1, 0, 1023, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("これて何か違う…\nあああすみません！", "天野 すずめ", 0, 0, 1, 2, 1.4, "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, 1025, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("離しませんわ………\n絶対に…!!", "倉石 恵理子", 0, 0, 1, 2, 1.4, "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 1, 0, 1027, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("…そうでしょ？？", "佐々木 咲恋", 0, 0, 1, 2, 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, 1028, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("あはは、\n私もまだまだだなぁ～", "桜井 望", 0, 0, 1, 2, 1.4, "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, 1029, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", "ニノン・ジュベール", 0, 0, 1, 2, 1.4, "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, 1030, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("おかしいですね……", "上喜 しのぶ", 0, 0, 1, 2, 1.4, "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, 1031, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("そう、\nオラのボケに突っ込める相方が…！", "野戸まひる", 0, 0, 1, 2, 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 1, 0, 1033, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ちょ\nちょっと一杯飲んできます…！", "綾瀬 ゆかり", 0, 0, 1, 2, 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 1, 0, 1034, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("これ以上お話しすることは…\nないです！", "氷川 鏡華", 0, 0, 1, 2, 1.5, "氷川鏡華…です", "知らない人とは話しちゃいけないので", 1, 0, 1036, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎 栞", 0, 0, 1, 2, 1.4, "柏崎…栞です。", "……あ、アラーム。", 1, 0, 1038, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("野に咲く花が、\n唯一の話相手です。", "双葉 碧", 0, 0, 1, 2, 1.4, "ふ、双葉碧です。", "私、一人も友達がいなくて……", 1, 0, 1040, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("そう思っています。", "三角 千歌", 0, 0, 1, 2, 1.4, "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, 1042, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("う、疑ってすまなかったな…", "安芸 真琴", 0, 0, 1, 2, 1.4, "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 1, 0, 1043, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "イリヤ・オーンスタイン", 0, 0, 1, 2, 1.4, "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 1, 0, 1044, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("ｌク、クウカに何かご用ですか!?", "遠見 空花", 0, 0, 1, 2, 1.4, "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 1, 0, 1045, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまき", 0, 0, 1, 2, 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, 1046, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神 美冬", 0, 0, 1, 2, 1.4, "大神美冬よ！", "それでは早速クエストに…", 1, 0, 1048, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流", 0, 0, 1, 2, 1.4, "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 1, 0, 1049, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "玉泉美咲", 0, 0, 1, 2, 1.5, "アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で", 1, 0, 1050, 1, 0, 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES ("？？？？", "リマ", 0, 0, 1, 2, 1.4, "？？？", "？？？？", 1, 0, 1052, 1, 0, 0);
